(1, '1', '10 things a buyer should know', 'Admin', '10 Things Buyers Should Know When Purchasing a New Home\r\n\r\n\r\n	Understand the responsibilities of home ownership. ...\r\n	Speak with a mortgage person to get pre-approved for a loan. ...\r\n	Location, location, location. ...\r\n	A Room with a View. ...\r\n	Take a drive. ...\r\n	Don&#39;t judge a house by its cover. ...\r\n	Have a backup plan.\r\n\r\n\r\nTimes are indeed tougher these days and we are all ardently watching our dollars. While banks are not as quick to lend money as they were a few years ago, this doesn&rsquo;t mean, however, that you shouldn&rsquo;t consider purchasing a home if you don&rsquo;t own one already. While the housing market is down, inventory is up. There are many homes for sale that are being offered at very competitive prices. If you&rsquo;re in the market for a new home, now just may be the perfect time to make your purchase!\r\n\r\n&nbsp;', '1632735294-Build_1.jpg', '1', '2021-09-27 04:04:54', '2021-09-27 04:04:54'),
(2, '1', '5 Tips for sellers', 'Admin', 'Tips for Sellers', '1632735745-Build_2.jpg', '1', '2021-09-27 04:12:25', '2021-09-27 04:12:25');
