 on the property. Needs TLC with older roof and Air.', NULL, NULL, NULL, 'Single Family Residence', 'Residential', 'Terra Ceia Island is Florida\'s best kept secret. Large homesites with dense hammocks surrounded by Terra Ceia Bay with it\'s shallow inlets and bayous. A natural for fishing, paddle boarding, kayaking or nature watching. This home is situated on 1 ACRE with 2 bedroom 2 bath upstairs, a large finished room downstairs with another full bath. The living room has beautiful views overlooking the peaceful setting of the lush back yard and pond. The grounds are very private, filled with large shady oak trees and surrounded by mature Areca palms.  The 2- car garage has it\'s own 220 electrical panel if you wanted to add a workshop. The back of the house has a covered screened lanai and lots of room to add on. Bring your custom touches and your imagination. The Island community has a voluntary Village Association that allows you access the park, dock and boating. Easy access to the interstate, St. Petersburg and Sarasota. Located just south of the Skyway Bridge. There is a local post office, VIA building and 2 original churches from the early 1900\'s that add to the islands charm.', '17E', '27', NULL, NULL, NULL, '272.44', NULL, 'Shingle', NULL, '6', '0', 'Septic Tank', NULL, 'Appointment Only,Call Listing Agent,ShowingTime', NULL, NULL, NULL, 'None', 'Withdrawn', 'FL', '2021-07-31 20:42:23', '1', 'NONE', '2237.35', NULL, NULL, 'THE E 96.37 FT OF THE W 481.83 FT OF THE N 472.02 FT OF THE NW1/4 OF THE NE1/4 OF THE SE1/4 OF SEC 27, LESS RD R/W OFF N FOR 73RD ST W, (898/242) PI#21550.0015/7', '0', NULL, '2020', '1 to less than 2', '33S', '2.5%', 'Cable Connected,Water Connected', 'Mature Landscaping,Oak Trees', 'Trees/Woods', 'https://www.propertypanorama.com/instaview/stellar/A4499057', NULL, NULL, '0', 'SMALL POND', NULL, '0', NULL, '0', '0', 'Public', 'Pond', '1', NULL, '1978', 'PDR', NULL, 'Owner', 'Terra Ceia Island is Florida\'s best kept secret. Large homesites with dense hammocks surrounded by Terra Ceia Bay with it\'s shallow inlets and bayous. A natural for fishing, paddle boarding, kayaking or nature watching. This home is situated on 1 ACRE with 2 bedroom 2 bath upstairs, a large finished room downstairs with another full bath. The living room has beautiful views overlooking the peaceful setting of the lush back yard and pond. The grounds are very private, filled with large shady oak trees and surrounded by mature Areca palms.  The 2- car garage has it\'s own 220 electrical panel if you wanted to add a workshop. The back of the house has a covered screened lanai and lots of room to add on. Bring your custom touches and your imagination. The Island community has a voluntary Village Association that allows you access the park, dock and boating. Easy access to the interstate, St. Petersburg and Sarasota. Located just south of the Skyway Bridge. There is a local post office, VIA building and 2 original churches from the early 1900\'s that add to the islands charm.', '0', '0.00', '0.00', '2021-07-31 20:43:08', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'From the Skyway take the 1st Exit on the south end to US 19. First right into Terra Ceia is on Terra Ceia Road. Home is just past the post office on your left.\r\nFrom Bradenton-Sarasota get onto US 19 from Palmetto head north. Take the 3rd entry into Terra Ceia. Go by the Marathon gas station (1st entry) past Kay Hubbard to Terra Ceia Road on your left. Go past the post office to 781 Terra Ceia Road on your left.', '27.5788', '-82.583657', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'TERRA CEIA', '781', 'ROAD', NULL, '781 TERRA CEIA RD', NULL, 1, 1, NULL, NULL, '2021-08-18 02:27:14', '2021-10-07 06:59:22'),
(2, 'https://api.mlsgrid.com/v2/Property(\'MFROM615328\')', '0', NULL, NULL, NULL, 'Other', '2545', 'Annually', 'Common Area Taxes,Private Road', '1', NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, 'Square Feet', NULL, '3%-$295', '0.72', NULL, NULL, NULL, 'OCALA', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Deed Restrictions,Horses Allowed', NULL, NULL, NULL, NULL, 'Marion', '166', '319900.00', '166', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Belleview Elementary School', NULL, NULL, NULL, NULL, NULL, NULL, 'na', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Belleview High School', NULL, NULL, NULL, '0', '0', '0', '1', NULL, NULL, NULL, 'Ocala - Marion', '816-714-0060', 'larrystaab1@gmail.com', '904-996-9147', 'Larry Staab', 'MFR546937267', 'MFR252011351', '2610', '816-714-0060', 'http://Larrystaab. com', 'Tampa', 'Exclusive Right To Sell', '2021-02-13', 'MFROM615328', 'MFR549287444', '549287444', NULL, '904-996-9147', '1041770', 'MFR204741668', 'MFR270523109', 'FLORIDA HOMES REALTY & MORTGAGE', '904-996-9144', 'http://Larrystaab. com', '319900', NULL, NULL, 'Square Feet', 'Buildable,Cleared,Pasture,Room For Pool,Paved,Private,Zoned for Horses', '10.36', '700x638', '446926', NULL, NULL, NULL, NULL, '34480 - Ocala', 'Expired', NULL, '2021-07-31 22:41:02', NULL, NULL, '212.08', NULL, '0%', NULL, NULL, NULL, '2021-07-31', '2021-02-15 01:36:15', '319900', 'mfrmls', NULL, NULL, NULL, NULL, NULL, NULL, 'Fee Simple', '37375-036-00', NULL, NULL, NULL, 'Yes', NULL, '2021-04-30 23:21:35', '15', NULL, NULL, NULL, '34480', NULL, NULL, 'Active', NULL, 'Please contact Agent for gate code *A sellers broker fee of $295.00 is to be paid out of Buyers agent or Transactional agent commissions at closing to Florida Home Realty & Mortgage.*', NULL, NULL, NULL, NULL, 'Land', 'You will appreciate one of the most beautiful entree gates in Ocala as it greets and invites you and your guests to the incredible equestrian community of Via Paradisus. The breath taking grandaddy, oak-lined boulevard is lit at night and leads you back into your private home site. A recent sale (1/28/21) of $2.8 million, more then demonstrates the value and desirability of Via Paradisus and the estate is located only 2 lots over. Lot 36 is 10.26 acres and offers a terrific home-site with Grandaddy Oaks and level ground for building, views of horse country, and rolling hills. Via Paradisus is located across from the Florida Horse Park, and has a private trailhead with horse trailer parking on the Greenway. It’s just 20 minutes from the World Equestrian Center! There are reasonable General building and site requirements: 3000 sf L/A 1story or 2000 main level on 2 story home, 2 car grg, 9 horses or cows or any combination, additional buildings such as barn, stables, guest house allowed. There is lots of space for paddocks, barn/stable and grazing. Via Pardisus provides direct access to the Florida Green Way and a future trail-head building to be constructed at the trail entry point. The easy access to the Greenway offers a treasure of outdoor adventure, with hundreds of miles for horseback riding, mountain biking, hiking or just plain relaxing and enjoying Florida nature. Via Paradisus has and is one of the only private access points to the Florida Greenway trails! All measurements, restrictions, and information provided here are not guaranteed and it is the responsibility of the buyer and their due diligence to confirm all information presented in this listing.', '22E', '33', NULL, NULL, NULL, '0.72', NULL, NULL, 'Private Road', NULL, NULL, 'Septic Needed', 'Gated Community', 'Call Listing Agent', NULL, NULL, NULL, 'None', 'Expired', 'FL', '2021-07-31 22:41:02', NULL, 'VIA PARADISUS', '50.83', '0000-36', '009-058,VIA', 'SEC 33 TWP 16 RGE 22 PLAT BOOK 009 PAGE 058 VIA PARADISUS LOT 36', '36', NULL, '2020', '10 to less than 20', '16S', '3%-$295', 'Electricity Available,Phone Available,Underground Utilities', 'Oak Trees,Wooded', NULL, '